import React, { useEffect } from "react";

const Chatbox = () => {
  useEffect(() => {}, []);
  const sendMessage = () => {};
  return (
    <div className="chatbox" id="chatbox">
      <div class="chat-form-wrapper">
        <form onSubmit={sendMessage}>
          <input type="text" id="chat-input" />

          <button
            id="chat-send-button"
            type="submit"
            onClick={sendMessage}
          ></button>
        </form>
      </div>
    </div>
  );
};

export default Chatbox;
